using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// An attachment behavior specifies a dynamic connection between two dynamic items, or between a dynamic item and an anchor point. By default, an item’s attachment point is at its center, but you can change that.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIAttachmentBehavior_Class/index.html#//apple_ref/occ/cl/UIAttachmentBehavior"/>    [iOSVersion(7)]    public class UIAttachmentBehavior : UIDynamicBehavior//, AnyObject, NSObjectProtocol    {        /// <summary>        /// Initializes an attachment behavior that connects the center point of a dynamic item to an anchor point.        /// </summary>        /// <param name="item">The dynamic item to which you are applying an attachment behavior.</param>        /// <param name="attachedToAnchor">The anchor point for the attachment behavior, relative to the coordinate system for the behavior’s associated dynamic animator. For more information, see the Overview in UIDynamicAnimator Class Reference.</param>        [iOSVersion(7)]        [Export("convenience init")]        public UIAttachmentBehavior(UIDynamicItem item, CGPoint attachedToAnchor) { }                /// <summary>        /// Initializes an attachment behavior that connects the center point of a dynamic item to the center point of another dynamic item.        /// </summary>        /// <param name="item">The first of two dynamic items connected by the attachment behavior.</param>        /// <param name="attachedToItem">The second of two dynamic items connected by the attachment behavior.</param>        [iOSVersion(7)]        [Export("convenience init")]        public UIAttachmentBehavior(UIDynamicItem item, UIDynamicItem attachedToItem) { }                /// <summary>        /// Initializes an attachment behavior that connects a specified point in a dynamic item to an anchor point.        /// </summary>        /// <param name="item">The dynamic item to which you are applying an attachment behavior.</param>        /// <param name="offsetFromCenter">The point, within the dynamic item and described as an offset from its center point, for the attachment behavior.</param>        /// <param name="attachedToAnchor">The anchor point for the attachment behavior, relative to the coordinate system for the behavior’s associated dynamic animator. For more information, see the Overview in UIDynamicAnimator Class Reference.</param>        [iOSVersion(7)]        [Export("convenience init")]        public UIAttachmentBehavior(UIDynamicItem item, UIOffset offsetFromCenter, CGPoint attachedToAnchor) { }                /// <summary>        /// Initializes an attachment behavior that connects a specified point in one dynamic item to a specified point in another dynamic item.        /// </summary>        /// <param name="item">The first of two dynamic items connected by the attachment behavior.</param>        /// <param name="firstOffsetFromCenter">The point, within the first dynamic item and described as an offset from its center point, for the attachment.</param>        /// <param name="attachedToItem">The second of two dynamic items connected by the attachment behavior.</param>        /// <param name="secondOffsetFromCenter">The point, within the second dynamic item and described as an offset from its center point, for the attachment.</param>        [iOSVersion(7)]        [RenameParameter("firstOffsetFromCenter", "offsetFromCenter")]        [RenameParameter("secondOffsetFromCenter", "offsetFromCenter")]        public UIAttachmentBehavior(UIDynamicItem item, UIOffset firstOffsetFromCenter, UIDynamicItem attachedToItem, UIOffset secondOffsetFromCenter) { }                /// <summary>        /// The dynamic items connected by the attachment behavior. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("items")]        public AnyObject[] Items { get; private set; }                /// <summary>        /// The anchor point for an attachment behavior of type UIAttachmentBehaviorTypeAnchor.        /// </summary>        [iOSVersion(7)]        [Export("anchorPoint")]        public CGPoint AnchorPoint { get; set; }                /// <summary>        /// The type of the attachment behavior. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("attachedBehaviorType")]        public UIAttachmentBehaviorType AttachedBehaviorType { get; private set; }                /// <summary>        /// The amount of damping to apply to the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("damping")]        public CGFloat Damping { get; set; }                /// <summary>        /// The frequency of oscillation for the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("frequency")]        public CGFloat Frequency { get; set; }                /// <summary>        /// The distance, in points, between the two attachment points of the attachment behavior.        /// </summary>        [iOSVersion(7)]        [Export("length")]        public CGFloat Length { get; set; }    }    /// <summary>    /// The type of an attachment behavior, indicating what a dynamic item is attached to.    /// </summary>    [iOSVersion(7)]    public enum UIAttachmentBehaviorType    {        /// <summary>        /// Designates an attachment behavior that connects a dynamic item to another dynamic item.        /// </summary>        [iOSVersion(7)]        Items,        /// <summary>        /// Designates an attachment behavior that connects a dynamic item to an anchor point.        /// </summary>        [iOSVersion(7)]        Anchor,    }}